gJW(){return"I discovered the passion for Flutter in 2020, becoming a Full-Stack professional capable of developing mobile applications from scratch to the final product. At Exacology, I worked as an Android developer, taking on great responsibilities after Senior left. I look for new opportunities to apply my skills in challenging projects."},
