gVJ(){return"In the project, I developed the front-end following the principles of clean code and the MVC/MVVM architecture. My responsibilities included the planning and execution of complex features, as well as the proposition of technological improvements to the system. I worked as development coordinator, working together with the backend team, designer and product manager. We use versioning tools like Git and adopt agile methodologies like Scrum. The application had three main sections: a Chat, psychological testing area and user lists in various categories, providing users with a way to assess their connections beyond the initial appearance. A major challenge in this project was my first contact with websocket, where I implemented from scratch all chat from a WS server integrated with an API written in python where I stored the messages sent in the database."},
gVK(){return"The project in development uses the Dart language and relies on the collaboration of veterinarians to create an application that stores and organizes information about workplaces and the patients treated in those places. The goal is to facilitate the generation of daily documents, such as shift reports, clinical reports, and prescriptions. The idea is that, in the future, this information can be shared among users of the application's network. Currently, the app is not yet available on the Play Store."},
