gVJ(){return"No projeto, desenvolvi o front-end seguindo os princ\xedpios de clean code e a arquitetura MVC/MVVM. Minhas responsabilidades inclu\xedam o planejamento e a execu\xe7\xe3o de funcionalidades complexas, bem como a proposi\xe7\xe3o de melhorias tecnol\xf3gicas para o sistema. Atuei como coordenador do desenvolvimento, trabalhando em conjunto com a equipe de backend, designer e gerente de produto. Utilizamos ferramentas de versionamento como o Git e adotamos metodologias \xe1geis, como o Scrum. O aplicativo contava com tr\xeas se\xe7\xf5es principais: um Chat, \xe1rea de testes psicol\xf3gicos e listas de usu\xe1rios em categorias diversas, proporcionando aos usu\xe1rios uma maneira de avaliar suas conex\xf5es al\xe9m da apar\xeancia inicial. Um grande desafio nesse projeto foi meu primeiro contato com webSocket, onde eu implementei do zero todo o chat a partir de um servidor WS integrado com uma API escrita em python onde armazenava as mensagens enviadas no banco de dados."},
